import React from 'react';
import PopUp from '../components/popupInfo.component';

function errorsHandle(error) {
    let message = error.message
    let tipe = 'alert'
    switch (error.code) {
        case 1:
            break;
        case 2:
            break;
        case 3:
            break;
        case 4:
            tipe = 'error'
            break;
    }
    return (<PopUp tipe={tipe} message={message} />)

}
export default errorsHandle;
